import React from 'react';

function Songs({songs}) {
    return (
        <div>
            {
                songs.sort((song1, song2) => song2.year - song1.year)
                    .map((song, idx) => (
                        <div key={idx} onClick={handleClick}>{song.title}</div>

                    ))
            }
        </div>
    );
}

export default Songs;
